import { useDispatch, useSelector } from 'react-redux';
import { Layout, Menu } from 'antd';
import options from './options';
// import Scrollbars from '@app/components/utility/customScrollBar';
import appActions from '../../../redux/app/actions';
// import Logo from '@app/components/utility/logo';
import SidebarWrapper from './Sidebar.styles';
import SidebarMenu from './SidebarMenu';
import SubMenu from 'antd/lib/menu/SubMenu';
// import changeCurrent from '../../../redux/app/actions';
// import logo from "../../../assets/images/wewey66556.svg";
// const SubMenu = Menu.SubMenu;
// const MenuItemGroup = Menu.ItemGroup;
const { Sider } = Layout;

var {toggleOpenDrawer,
changeOpenKeys,
changeCurrent,
toggleCollapsed} = appActions;

export default function Sidebar() {
  const dispatch = useDispatch();
  const {
    view,
    openKeys,
    collapsed,
    openDrawer,
    current,
    height,
  } = useSelector(state => state.App);
//   const customizedTheme = useSelector(
//     state => state.ThemeSwitcher.sidebarTheme
//   );

  function handleClick(e) {
    dispatch(changeCurrent([e.key]));
    if (view === 'MobileView') {
      setTimeout(() => {
        dispatch(toggleCollapsed());
        // dispatch(toggleOpenDrawer());
      }, 100);

      // clearTimeout(timer);
    }
  }
  function onOpenChange(newOpenKeys) {
    const latestOpenKey = newOpenKeys.find(
      key => !(openKeys.indexOf(key) > -1)
    );
    console.info(openKeys);
    const latestCloseKey = openKeys.find(
      key => !(newOpenKeys.indexOf(key) > -1)
    );
    let nextOpenKeys = [];
    if (latestOpenKey) {
      nextOpenKeys = getAncestorKeys(latestOpenKey).concat(latestOpenKey);
    }
    if (latestCloseKey) {
      nextOpenKeys = getAncestorKeys(latestCloseKey);
    }
    dispatch(changeOpenKeys(nextOpenKeys));
  }
  const getAncestorKeys = key => {
    const map = {
      sub3: ['sub2'],
    };
    return map[key] || [];
  };

  const isCollapsed = collapsed && !openDrawer;
  const mode = isCollapsed === true ? 'vertical' : 'inline';
  const onMouseEnter = event => {
    if (collapsed && openDrawer === false) {
      dispatch(toggleOpenDrawer());
    }
    return;
  };
  const onMouseLeave = () => {
    if (collapsed && openDrawer === true) {
      dispatch(toggleOpenDrawer());
    }
    return;
  };
  const styling = {
    backgroundColor: "#0b0b37",
  };
  const submenuStyle = {
    backgroundColor: '',
    color: "rgb(200 200 200)",
  };
  const submenuColor = {
    color: "rgb(200 200 200)",
  };
  return (
    <SidebarWrapper style={styling}>
      <Sider
        trigger={null}
        collapsible={true}
        collapsed={isCollapsed}
        width={240}
        className="isomorphicSidebar"
        onMouseEnter={onMouseEnter}
        onMouseLeave={onMouseLeave}
        style={styling}
      >
        <span style={{color:"#fff",width : "100%"}}><img src={""} alt="logo"/></span>
        {/* <Logo collapsed={isCollapsed} /> */}
        {/* <Scrollbars style={{ height: height - 70 }}> */}
          <Menu
            onClick={handleClick}
            theme="dark"
            className="isoDashboardMenu"
            mode={mode}
            openKeys={isCollapsed ? [] : openKeys}
            selectedKeys={current}
            // onOpenChange={onOpenChange}
          >
            <SubMenu
              key="sub1"
              title={
                <span className="isoMenuHolder" style={submenuColor}>
                  <i className="ion-android-options" />
                  <span className="nav-text">
                     Sidebar Menu Levels
                  </span>
                </span>
              }
            >
              <MenuItemGroup
                key="g1"
                title={"Menu Title 1"}
              >
                <Menu.Item style={submenuStyle} key="1">
                  Sidebar Optiosn 1
                </Menu.Item>
                <Menu.Item style={submenuStyle} key="2">
                Sidebar Optiosn 2
                </Menu.Item>
              </MenuItemGroup>
              <MenuItemGroup
                key="g2"
                title={"Menu title 2"}
              >
                <Menu.Item style={submenuStyle} key="3">
                Sidebar Optiosn 3
                </Menu.Item>
                <Menu.Item style={submenuStyle} key="4">
                Sidebar Optiosn 4
                </Menu.Item>
              </MenuItemGroup>
            </SubMenu>
          </Menu>
        {/* </Scrollbars> */}
      </Sider>
    </SidebarWrapper>
  );
}
